/*
LC#686
Given two strings A and B, find the minimum number of times A has to be repeated such that B is a substring of it. If no such solution, return -1.

For example, with A = "abcd" and B = "cdabcdab".

Return 3, because by repeating A three times (“abcdabcdabcd”), B is a substring of it; and B is not a substring of A repeated two times ("abcdabcd").

Note:
The length of A and B will be between 1 and 10000.
 */
public class RepeatedStringMatching {
    public int repeatedStringMatch(String a, String b) {
        // b must be of type (s2stub)s1s2s1s2...s2(s1stub), where a is s1s2, for a to be able to match with it. so at least this number
        // +2 for the two stubs
        // can be improved further if we do kmp
        int times = b.length() / a.length() + 2;
        StringBuilder sb = new StringBuilder();
        for (int i = 1; i <= times; i++) {
            sb.append(a);
            if (sb.toString().indexOf(b) != -1) {
                return i;
            }
        }
        return -1;
    }


    public static void main(String[] args) {
        System.out.println(new RepeatedStringMatching().repeatedStringMatch("abcd", "cdabcdab"));
        System.out.println(new RepeatedStringMatching().repeatedStringMatch("", ""));
        //  System.out.println(new Crap().repeatedStringMatch("a", "aa"));

    }
}
